import React from 'react';
import HighchartComp from '../highchart/highchatComp';

function PerRiverComp() {
    const options = {
        title: {
          text: 'My stock chart'
        },
        series: [{
          data: [1, 2, 3]
        }]
    }

    return (
        <>
            <div className = 'card h-100' style = {{ minHeight : "200px" }}>
                <div className = 'card-body'>
                    <h3 className = 'card-title'>{ props.pricingName }</h3>
                </div>
            </div>
            <HighchartComp options = {options} />
        </>
    );
}

export default PerRiverComp;
